import React from 'react';
import { Flex, Text } from '@chakra-ui/react';
import SMButton from '../../styled/Chakra.custom';

const Index = () => {
    return (
        <Flex justifyContent="space-around" alignItems="center" padding="1.5rem" w="100%" >
            <Text>
                Hai bro
            </Text>
            <SMButton type="outlined" >Connect with me</SMButton>
        </Flex>
    )
}

export default Index
